import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { useState, useMemo } from "react";
import {
  matchCapacity,
  matchPriceRange,
} from "../../helper/flightFilterHelper";

export default function Results() {
  // default values to avoid undefined errors
  const { results = {}, form = {} } = useSelector(
    (state) => state.search || {}
  );

  const [priceRangeFilter, setPriceRangeFilter] = useState("all");
  const [capacityFilter, setCapacityFilter] = useState("all");

  const tripType = form.tripType || "oneway";

  // ✅ Get flights based on trip type
  const flights = useMemo(() => {
    if (tripType === "oneway") {
      return results?.outboundFlights || [];
    } else if (tripType === "roundtrip") {
      return results?.returnFlights?.length
        ? results?.returnFlights
        : results?.outboundFlights || [];
    }
    return [];
  }, [tripType, results]);

  // ✅ Price calculation (double for round trip right now)
  const getFlightPrice = (flight) => {
    const basePrice = flight?.priceHeads?.[0]?.amount || 0;
    return tripType === "roundtrip" ? basePrice * 2 : basePrice;
  };

  // ✅ Apply Filters
  const filteredResults = flights.filter((flight) => {
    const price = getFlightPrice(flight);
    const capacity = flight?.capacity || 0;

    const priceMatch = matchPriceRange(price, priceRangeFilter);
    const capacityMatch = matchCapacity(capacity, capacityFilter);

    return priceMatch && capacityMatch;
  });

  return (
    <section className="flight-results">
      <div className="container">
        <h2>
          Available Flights —{" "}
          <span style={{ textTransform: "capitalize" }}>{tripType}</span>
        </h2>

        {/* Filters */}
        <div className="filters">
          <select
            value={priceRangeFilter}
            onChange={(e) => setPriceRangeFilter(e.target.value)}
          >
            <option value="all">All Prices</option>
            <option value="under5">Under ₹5L</option>
            <option value="5to10">₹5L − ₹10L</option>
            <option value="10plus">Above ₹10L</option>
          </select>

          <select
            value={capacityFilter}
            onChange={(e) => setCapacityFilter(e.target.value)}
          >
            <option value="all">All Capacity</option>
            <option value="1to5">1 − 5 Seats</option>
            <option value="6to10">6 − 10 Seats</option>
            <option value="11plus">11+ Seats</option>
          </select>
        </div>

        {/* Results List */}
        <div className="flight-list">
          {filteredResults.length === 0 ? (
            <p>No flights available for this search.</p>
          ) : (
            filteredResults.map((flight) => (
              <div className="flight-card" key={flight._id}>
                <div className="flight-img">
                  <img
                    src={
                      flight.images?.[0]?.url ||
                      "/assets/images/plane-default.jpg"
                    }
                    alt={flight.name}
                  />
                </div>

                <div className="flight-info">
                  <h3>{flight.name}</h3>
                  <p>Seats: {flight.capacity}</p>
                  <p>Flight Time: {flight.travelTime} mins</p>
                </div>

                <div className="flight-price">
                  <h4>
                    ₹{getFlightPrice(flight).toLocaleString("en-IN")}
                    <span>
                      {tripType === "roundtrip" ? " Round Trip" : " One Way"}
                    </span>
                  </h4>

                  <Link to={`/book/${flight._id}`} className="btn btn-fill">
                    Book Now
                  </Link>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </section>
  );
}
